import React, { useState, useEffect } from 'react';
import './Projects.css';
import researchImage1 from '../assets/pr1.jpeg'; // Ensure this path is correct
import researchImage2 from '../assets/pr2.jpeg'; // Ensure this path is correct
import researchImage3 from '../assets/pr3.jpeg'; // Ensure this path is correct

const Research = () => {
  const [expandedProject, setExpandedProject] = useState(null); // Track which project is expanded

  // Similar to the previous section, disable scrolling when the project is expanded
  useEffect(() => {
    if (expandedProject) {
      document.body.style.overflow = 'hidden';  // Disable body scroll
    } else {
      document.body.style.overflow = 'auto';    // Re-enable body scroll when closed
    }
  }, [expandedProject]);

  const toggleProjectDetails = (project) => {
    setExpandedProject(expandedProject === project ? null : project);
  };

  return (
    <section id="research" className="research">
      <h2>Projects</h2>
      <div className="research-container">
        {/* Project 1 */}
        {expandedProject === null || expandedProject === 'project1' ? (
          <div className={`research-card ${expandedProject === 'project1' ? 'expanded' : ''}`}>
            <div className="research-image-wrapper">
              <img src={researchImage1} alt="Research 1" className="research-image" />
            </div>
            <div className="research-text">
              <h3>Colorizing Black & White Photos using Deep Learning</h3>
              <p>Utilized advanced deep learning models, particularly conditional GANs, for image colorization, 
                 leveraging the Lab color space to achieve natural and visually appealing color predictions.</p>
              {expandedProject === 'project1' ? (
                <div className="detailed-description full-screen">
                  <h3>Colorizing Black & White Photos using Deep Learning</h3>
                  <p>Detailed project description goes here. You can add more technical details, challenges faced, or any specific algorithms used in this project.</p>
                  <button onClick={() => toggleProjectDetails('project1')} className="close-btn">Close</button>
                </div>
              ) : (
                <a href="#learn-more" onClick={() => toggleProjectDetails('project1')}>Learn more</a>
              )}
            </div>
          </div>
        ) : null}

        {/* Project 2 */}
        {expandedProject === null || expandedProject === 'project2' ? (
          <div className={`research-card ${expandedProject === 'project2' ? 'expanded' : ''}`}>
            <div className="research-image-wrapper">
              <img src={researchImage2} alt="Research 2" className="research-image" />
            </div>
            <div className="research-text">
              <h3>Library Management System</h3>
              <p>Developed a Library Management System from inception, including database design and RESTful API 
              integration with a React frontend. Achieved seamless user interaction and efficient data management.</p>
              {expandedProject === 'project2' ? (
                <div className="detailed-description full-screen">
                  <h3>Library Management System</h3>
                  <p>More details about the project go here. You can expand on the technology stack, unique challenges, and any innovations made during development.</p>
                  <button onClick={() => toggleProjectDetails('project2')} className="close-btn">Close</button>
                </div>
              ) : (
                <a href="#learn-more" onClick={() => toggleProjectDetails('project2')}>Learn more</a>
              )}
            </div>
          </div>
        ) : null}

        {/* Project 3 */}
        {expandedProject === null || expandedProject === 'project3' ? (
          <div className={`research-card ${expandedProject === 'project3' ? 'expanded' : ''}`}>
            <div className="research-image-wrapper">
              <img src={researchImage3} alt="Research 3" className="research-image" />
            </div>
            <div className="research-text">
              <h3>Price Prediction System using Machine Learning Models</h3>
              <p>Developed a machine learning-based price prediction system utilizing Flask for the frontend. Integrated data visualization libraries into the frontend to provide users with insightful visual representations of the predicted price trends.</p>
              {expandedProject === 'project3' ? (
                <div className="detailed-description full-screen">
                  <h3>Price Prediction System using Machine Learning Models</h3>
                  <p>Here you can describe in-depth details of the models you used, how Flask was utilized, and challenges faced during integration with data visualization libraries.</p>
                  <button onClick={() => toggleProjectDetails('project3')} className="close-btn">Close</button>
                </div>
              ) : (
                <a href="#learn-more" onClick={() => toggleProjectDetails('project3')}>Learn more</a>
              )}
            </div>
          </div>
        ) : null}
      </div>
    </section>
  );
};

export default Research;
